import question from "../../images/question.png";
import ContactPerson from "./ContactPerson";
import AddContactPerson from "./AddContactPeroson";
import classes from "./SelectChatMainFrame.module.css";

function SelectChatMainFrame() {
    const contactList = [
        { name: "平台", personality: "預設" },
        { name: "子安", personality: "測試" },
        { name: "ZK", personality: "測試2" },
    ];

    console.log(contactList.length)

    return (
        <div className={classes.outerContainer}>
            <div className={classes.header}>
                <div className={classes.title}>選擇聊天對象</div>
                <img
                    src={question}
                    alt="更多資訊"
                    className={classes.question}
                />
            </div>
            <div className={classes.contactList}>
                {contactList.map((person, index) =>
                    <ContactPerson name={person.name} personality={person.personality} />
                )}
                <AddContactPerson />
            </div>
            <button className={classes.button}>開始聊天</button>
        </div>
    );
}

export default SelectChatMainFrame;
